import React from "react"
import TabelaKarte from "./TabelaKarte";

class PrikazKarata extends React.Component{
    constructor(){
        super()
        this.state={
            karte: []
        }
    }

    componentDidMount(){
        const config={
            headers: new Headers({'Authorization': 'Bearer ' + localStorage.getItem('jwt')},
                                  {'Access-Control-Allow-Methods':'GET'}),
          };
          console.log("Username: "+this.props.state.user.username)
        fetch('http://localhost:8080/bioskop/karte/'+this.props.state.user.username,config)
            .then(res => res.json())
            .then(res => {
                console.log(res)
                this.setState({
                    karte: res
                })
            })
    }

    render(){
        return(
            <div style={{display: "inline-block", textAlign:"right"}} id="prikazKarata">
                <TabelaKarte state={this.state}/>
            </div>
        )
    }
}

export default PrikazKarata
